// Simple config object to cut down on boilerplate
const config = {
  REG_CODE: process.env.REACT_APP_REGISTER_CODE,
  REG_ADMIN_CODE: process.env.REACT_APP_REGISTER_ADMIN_CODE,
};

export default config;
